CREATE TABLE COURSE(
    id          VARCHAR(10),
    name        VARCHAR(64),
    hp          REAL,
    department  VARCHAR(32),
    programs    TEXT,
    period      TEXT
);

CREATE TABLE PROGRAM(
    id            VARCHAR(10),
    name          VARCHAR(64),
    hp            REAL,
    level         VARCHAR(64),
    department    VARCHAR(32),
    studentcount  INTEGER,
    periods       TEXT
);

CREATE TABLE STAFF(
    id            VARCHAR(8),
    fname         VARCHAR(64),
    lname         VARCHAR(64),
    title         VARCHAR(32),
    department    VARCHAR(32),
    birthyear     INTEGER,
    telnr         VARCHAR(32)
);

CREATE TABLE ROOM(
    number        VARCHAR(8),
    entries       TEXT
);





